column8:
在庫が無くなった場合は、取り寄せになります。<br>
納期を確認出来次第、ご連絡させていただきます。<br><br>

四角サイズ：8mm/9.5mm(3/8")/10mm/12.7mm(1/2")<br>
六角サイズ：10mm/12mm/14mm/17mm<br><br>

<font color="red">使用上の注意事項<br>
※本製品は車両のドレーンプラグ専用レンチです。<br><br>
※車両の年式等により、サイズ・形状が異なる場合があります。<br><br>
※車両のドレーンプラグサイズに合ったサイズで使用してください。<br><br>
※ドレーンプラグ周辺に突起物がある場合は、使用できない場合があります。<br><br>
※車両によりドレーンプラグ硬く締まっている場合がありますので、緩める際はご注意ください。<br><br>
※過剰トルクで作業した場合、突起部が破損してしまう場合があります。<br>（四角8mm最大トルク：49N/m）来<br>※本製品は消耗品です。</font><style type="text/css">
